import React from 'react';
import PythonIcn from '../../assets/img/python.png';
import DjangoIcn from '../../assets/img/django.jpg';
import DrfIcon from '../../assets/img/drf-logo2.png';
import ReactIcn from '../../assets/img/javascript.png';
import JsIcn from '../../assets/img/javascript.png';
import SkilItem from './SkilItem';

const items = [
  {
    id: 1,
    display: 'Python',
    image: PythonIcn,
  },
  {
    id: 2,
    display: 'Instagram',
    image: DjangoIcn,
  },
  {
    id: 3,
    display: 'LinkedIn',
    image: DrfIcon,
  },
  {
    id: 4,
    display: 'LinkedIn',
    image: JsIcn,
  },
  {
    id: 5,
    display: 'LinkedIn',
    image: ReactIcn,
  },
];

const Skils = () => {
  return (
    <div className='skills'>
      <div className='container'>
        {items.map((item) => (
          <SkilItem key={item.id} item={item} />
        ))}
      </div>
    </div>
  );
};

export default Skils;
